import React, {useState, useEffect} from "react";

function Sort(coins){
    const sortedCoins = coins
    // .sort((a, b) => coinA.current_price > coinB.current_price ? 1 : -1)
    .sort(function (a, b) {
        return a.current_price - b.current_price;
    });

    console.log(sortedCoins);

    return(
        <button>Sort</button>
    )
}

export default Sort;
